import './style.css';
import GameBox from '../gamebox/gamebox';
import WhiteBox from '../whitebox/whitebox';

const games = [
  {
    id: 1,
    team1: "SIS",
    team2: "KIS",
    score1: 2,
    score2: 0,
    livetext: "LIVE"
  }
]

function FixtureBox({ title, width, height }) {
  let boxwidth, boxheight;
  if (width === undefined) boxwidth = 300;
  else boxwidth = width;

  if (height === undefined) boxheight = 600;
  else boxheight = height;
  return (
    // <div className="square" style={{ width: { boxwidth }, height: { boxheight } }}>
    <div className="square" style={{ width: boxwidth, height: boxheight }}>
      <h1 className="title">{title}</h1>
      {games.map(game => {
        return (
          <GameBox id={game.id} team1={game.team1} team2={game.team2} score1={game.score1} score2={game.score2} livetext={game.livetext} />
        );
      })
      }
    </div>
  );
}

